import{_ as A,o as z,c as P,b as K}from"./app.2b9aacdc.js";const U={},a=K('<img src="https://count-viewer.vercel.app//api/blog/view?url=https://creatipath.github.io/illustrator-short/section5.html" alt="Image 1" style="float:left;"><h1 id="_5-illustrator-lam-\u0111uoc-gi" tabindex="-1"><a class="header-anchor" href="#_5-illustrator-lam-\u0111uoc-gi" aria-hidden="true">#</a> 5. ILLUSTRATOR L\xC0M \u0110\u01AF\u1EE2C G\xCC ?</h1><p>Nh\u01B0 m\u1ED9t ph\u1EA7n m\u1EC1m \u2018qu\u1ED1c d\xE2n\u2019, Adobe Illustrator c\xF3 th\u1EC3 h\u1ED7 tr\u1EE3 t\u1ED1i \u0111a vi\u1EC7c thi\u1EBFt k\u1EBF c\u1EE7a designers. D\u01B0\u1EDBi \u0111\xE2y, m\xECnh s\u1EBD gi\u1EDBi thi\u1EC7u b\u1EA1n 5 \u1EE9ng d\u1EE5ng n\u1ED5i b\u1EADt c\u1EE7a ph\u1EA7n m\u1EC1m n\xE0y.</p><p><strong>1. V\u1EBC MINH HO\u1EA0</strong></p><p>T\u1EEB vi\u1EC7c t\u1EA1o vector v\xE0 ch\u1EC9nh s\u1EEDa theo c\xE1c \u0111\u1EB7c t\xEDnh m\xE0u s\u1EAFc, h\xECnh d\u1EA1ng, \u0111\u1ED9 d\xE0y; Illustrator h\u1ED7 tr\u1EE3 b\u1EA1n \u0111\u1ED3 l\u1EA1i (sao ch\xE9p) l\u1EA1i c\xE1c b\u1EA3n v\u1EBD tay ho\u1EA1t h\xECnh tr\xEAn ph\u1EA7n m\u1EC1m; ho\u1EB7c s\xE1ng t\u1EA1o kh\xF4ng-gi\u1EDBi-h\u1EA1n c\xE1c h\xECnh v\u1EBD m\u1EDBi.</p><p>Trong ph\u1EA7n m\u1EC1m Adobe Illustrator, b\u1EA1n c\xF3 th\u1EC3 d\xF9ng c\xF4ng c\u1EE5 pen \u0111\u1EC3 v\u1EBD, k\u1EBFt h\u1EE3p c\xF9ng c\xF4ng c\u1EE5 gradient \u0111\u1EC3 t\u1EA1o h\xECnh s\u1ED1ng \u0111\u1ED9ng. Trong qu\xE1 tr\xECnh l\xE0m vi\u1EC7c v\u1EDBi vector tr\xEAn Adobe Illustrator, \u0111\u1EC3 l\xE0m vi\u1EC7c hi\u1EC7u qu\u1EA3 v\xE0 nhanh h\u01A1n, b\u1EA1n n\xEAn s\u1EED d\u1EE5ng <a href="https://colorme.vn/post/07-tips-giup-ban-lam-viec-voi-illustrator-nhanh-hon-47941" target="_blank" rel="noopener noreferrer"><strong>7 l\u01B0u \xFD n\xE0y</strong></a>.</p><p>D\u01B0\u1EDBi \u0111\xE2y l\xE0 m\u1ED9t v\xED d\u1EE5 h\xECnh v\u1EBD \u0111\u01B0\u1EE3c th\u1EF1c hi\u1EC7n tr\xEAn Adobe Illustrator, c\xF9ng xem nh\xE9:<img src="data:image/jpeg;base64," alt="https://d1j8r0kxyu9tj8.cloudfront.net/images/1559810813UZTGuV66UqbICnU.jpg"></p><h2 id="bo-nhan-dien-thuong-hieu" tabindex="-1"><a class="header-anchor" href="#bo-nhan-dien-thuong-hieu" aria-hidden="true">#</a> B\u1ED8 NH\u1EACN DI\u1EC6N TH\u01AF\u01A0NG HI\u1EC6U</h2><p>L\xE0 m\u1ED9t trong <a href="https://colorme.vn/blog/nguoi-moi-can-biet-tat-tan-tat-ve-8-dang-thiet-ke-do-hoa-phan-1-38721" target="_blank" rel="noopener noreferrer"><strong>8 d\u1EA1ng thi\u1EBFt k\u1EBF \u0111\u1ED3 ho\u1EA1 quan tr\u1ECDng</strong></a>, b\u1ED9 nh\u1EADn di\u1EC7n th\u01B0\u01A1ng hi\u1EC7u l\xE0 \u1EE9ng d\u1EE5ng ph\u1ED5 bi\u1EBFn v\u1EDBi Illustrator.</p><p>ph\u1EA7n m\u1EC1m illustrator h\u1ED7 tr\u1EE3 t\u1ED1t t\u1EEB vi\u1EC7c thi\u1EBFt k\u1EBF logo, c\xE1c ho\u1EA1 ti\u1EBFt hay thi\u1EBFt k\u1EBF bao b\xEC v\u1EC1 nh\u1EADn di\u1EC7n th\u01B0\u01A1ng hi\u1EC7u. \u0110i\u1EC1u n\xE0y b\u1EDFi v\xEC Illustrator l\xE0 v\u1EBD v\u1EDBi c\xE1c vector, h\xECnh h\u1ECDc, d\u1EC5 d\xE0ng cho designers th\u1EF1c hi\u1EC7n ph\xE1c th\u1EA3o, \u0111\u1ED3 l\u1EA1i h\xECnh v\u1EBD ho\u1EB7c ch\u1EC9nh s\u1EEDa.</p><p><img src="data:image/jpeg;base64," alt="https://d1j8r0kxyu9tj8.cloudfront.net/images/15598108639d5XSOfafZuo9vn.jpg"></p><p>Th\xF4ng th\u01B0\u1EDDng, c\xE1c designers s\u1EBD c\xF3 ph\xE1c th\u1EA3o s\u1EB5n logo ho\u1EB7c b\u1ED9 nh\u1EADn di\u1EC7n th\u01B0\u01A1ng hi\u1EC7u theo brand guideline, sau \u0111\xF3 ph\xE1c l\u1EA1i tr\xEAn ph\u1EA7n m\u1EC1m adobe illustrator v\u1EDBi c\xE1c c\xF4ng c\u1EE5 nh\u01B0 pen tool, shape. C\xF3 kh\xE1 nhi\u1EC1u d\u1EA1ng logo nh\u01B0 bi\u1EC3u t\u01B0\u1EE3ng, bi\u1EC3u t\u01B0\u1EE3ng ho\u1EB7c k\u1EBFt h\u1EE3p c\u1EA3 hai. Nh\u01B0ng m\u1ED7i th\u1EDDi k\xEC l\u1EA1i c\xF3 nh\u1EEFng thay \u0111\u1ED5i xu h\u01B0\u1EDBng \u0111\u1EC3 \u0111\xE1p \u1EE9ng th\u1ECB hi\u1EBFu ng\u01B0\u1EDDi ti\xEAu d\xF9ng. \u0110\u1EC3 c\xF3 \xFD t\u01B0\u1EDFng \u2018trendy\u2019 cho logo, xem ngay <a href="https://colorme.vn/post/10-xu-huong-thiet-ke-logo-cho-nam-2019-49900" target="_blank" rel="noopener noreferrer"><strong>10 xu h\u01B0\u1EDBng thi\u1EBFt k\u1EBF logo n\u0103m 2019 t\u1EA1i \u0111\xE2y.</strong></a></p><h2 id="an-pham-truyen-thong-khong-illustrator-thi-la-gi" tabindex="-1"><a class="header-anchor" href="#an-pham-truyen-thong-khong-illustrator-thi-la-gi" aria-hidden="true">#</a> \u1EA4N PH\u1EA8M TRUY\u1EC0N TH\xD4NG - KH\xD4NG ILLUSTRATOR TH\xCC L\xC0 G\xCC ?</h2><p>Th\u1ECB tr\u01B0\u1EDDng thi\u1EBFt k\u1EBF truy\u1EC1n th\xF4ng qu\u1EA3ng c\xE1o ng\xE0y c\xE0ng m\u1EDF r\u1ED9ng, l\xE0m th\u1EBF n\xE0o \u0111\u1EC3 s\u1EA3n ph\u1EA9m c\u1EE7a b\u1EA1n n\u1ED5i b\u1EADt tr\xEAn M\u1EA1ng x\xE3 h\u1ED9i hay Offline ?</p><p>C\xE2u tr\u1EA3 l\u1EDDi l\xE0 h\xE3y thi\u1EBFt k\u1EBF tr\xEAn ph\u1EA7n m\u1EC1m Adobe Illustrator. Kh\xF4ng \u0111\u01A1n thu\u1EA7n l\xE0 h\xECnh \u1EA3nh ch\u1EC9nh s\u1EEDa nh\u01B0 Photoshop, thi\u1EBFt k\u1EBF qua Illustrator t\u1EF1 do s\xE1ng t\u1EA1o v\xE0 s\u1ED1ng \u0111\u1ED9ng h\u01A1n v\u1EDBi c\xE1c n\xE9t v\u1EBD m\xE0u s\u1EAFc. V\u1EDBi c\xE1c s\u1EA3n ph\u1EA9m, s\u1EF1 ki\u1EC7n \u0111\xF2i h\u1ECFi s\u1EF1 s\xE1ng t\u1EA1o, l\xF4i cu\u1ED1n c\u1EA3m x\xFAc ng\u01B0\u1EDDi nh\xECn, Adobe Illustrator l\xE0 l\u1EF1a ch\u1ECDn t\u1ED1t h\u01A1n cho b\u1EA1n.</p><p>C\xF9ng xem m\u1ED9t \u1EA5n ph\u1EA9m s\xE1ng t\u1EA1o tr\xEAn ph\u1EA7n m\u1EC1m Illustrator n\xE0y nh\xE9:</p><p><img src="data:image/jpeg;base64," alt="https://d1j8r0kxyu9tj8.cloudfront.net/images/1559810888TFMm55oLgaAVJEE.jpg"></p><h2 id="infographic" tabindex="-1"><a class="header-anchor" href="#infographic" aria-hidden="true">#</a> INFOGRAPHIC</h2><p>L\xE0 vi\u1EBFt t\u1EAFt c\u1EE7a Information Graphic, Infographic l\xE0 h\xECnh th\u1EE9c \u0111\u1ED3 h\u1ECDa tr\u1EF1c quan s\u1EED d\u1EE5ng h\xECnh \u1EA3nh \u0111\u1EC3 tr\xECnh b\xE0y th\xF4ng tin, d\u1EEF li\u1EC7u ho\u1EB7c ki\u1EBFn th\u1EE9c th\u1EC3 hi\u1EC7n ch\xFAng m\u1ED9t c\xE1ch nhanh v\xE0 r\xF5 r\xE0ng. Nh\u01B0 v\u1EADy, m\u1EE5c \u0111\xEDch cu\u1ED1i c\u1EE7a infographic l\xE0 truy\u1EC1n t\u1EA3i th\xF4ng tin m\u1ED9t c\xE1ch d\u1EC5 hi\u1EC3u v\xE0 \u0111\u1EB9p m\u1EAFt!</p><p>\xA0<img src="data:image/jpeg;base64," alt="https://d1j8r0kxyu9tj8.cloudfront.net/images/1559810906iK0Yvahah6Ab0e3.jpg"></p><p>\u0110\u1EC3 l\xE0m Infographic, \u0111a ph\u1EA7n designers s\u1EED d\u1EE5ng ph\u1EA7n m\u1EC1m Illustrator, v\xE0 b\u1EA1n c\xF3 th\u1EC3 tham kh\u1EA3o c\xE1ch l\xE0m vi\u1EC7c nhanh h\u01A1n tr\xEAn ph\u1EA7n m\u1EC1m n\xE0y <a href="https://colorme.vn/blog/07-tips-giup-ban-lam-viec-voi-illustrator-nhanh-hon-47941" target="_blank" rel="noopener noreferrer">t\u1EA1i \u0111\xE2y</a> v\xE0 tham kh\u1EA3o c\xE1c y\u1EBFu t\u1ED1 t\u1EEB A-Z t\u1EA1o n\xEAn Infographic <a href="https://colorme.vn/blog/infographic-tu-a-z-49252" target="_blank" rel="noopener noreferrer"><strong>t\u1EA1i \u0111\xE2y</strong></a><strong>.</strong></p><h2 id="_9-sang-tao-icon" tabindex="-1"><a class="header-anchor" href="#_9-sang-tao-icon" aria-hidden="true">#</a> 9. S\xC1NG T\u1EA0O ICON</h2><p>N\u1EBFu b\u1EA5t ng\u1EDD, b\u1EA1n c\xF3 \xFD t\u01B0\u1EDFng cho c\xE1c icon \u2018hay ho\u2019, hay th\u1EED ph\xE1c ho\u1EA1 emoji theo s\u1EDF th\xEDch, th\xEC Adobe Illustrator l\xE0 tr\u1EE3 th\u1EE7 \u0111\u1EAFc l\u1EF1c cho b\u1EA1n. V\u1EDBi h\u1EC7 th\u1ED1ng Grid System, b\u1EA1n c\xF3 th\u1EC3 t\u1EA1o ra c\xE1c icon v\u1EDBi nh\u1EEFng shape (h\xECnh kh\u1ED1i) \u0111\u01A1n gi\u1EA3n nh\u01B0 vu\xF4ng, tr\xF2n, tam gi\xE1c..v.v</p><p><img src="data:image/jpeg;base64," alt="https://d1j8r0kxyu9tj8.cloudfront.net/images/1559810919DSr04U0T0ZPCoF2.jpg"></p>',24),t=[a];function o(r,f){return z(),P("div",null,t)}var F=A(U,[["render",o],["__file","section5.html.vue"]]);export{F as default};
